import React from "react";
import "./BaseBottom.css"

const BaseBottom = (props) => {
    const cTime=props.cTime;
    const dTime=props.dTime;
    const mTime=props.mTime;
    const wTime=props.wTime;
    const sTime=props.sTime;

    const IntervalCalc = () => {
        console.log("Comic:",cTime);
        console.log("Doodle:",dTime);
        console.log("Mandala:",mTime);
        console.log("Water:",wTime);
        console.log("Sketch:",cTime);
    }

    return (
        <div className="bottom_div">
            <button className="bottom_button" onClick={IntervalCalc}>Ok, Predict my choice!</button>    
        </div>
    )
};

export default BaseBottom;
